import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';
import './App.css';
import './Components/Navbar'
import Navbar from './Components/Navbar';
import Footer from './Components/Footer';
import Main from './Components/Main';

function App() {
  return (
  <>
  <Router>
  <Navbar/>
  <Switch>
    <Route path='/' exact/>
  </Switch>
  <Main/>
  <Footer/>
  </Router>
  </>
  );
}

export default App;
